  const [hcpData, setHcpData] = useState(null);

  useEffect(() => {
    fetchHcps();
  }, []);

  const fetchHcps = async () => {
    const response = await axios.get("http://localhost:8000/hcps/");
    // TODO why await this?
    const data = response.data.hcps;
    console.log("DATA", data);
    setHcpData(data);
  };
  return (
    <div className="App">
      <header className="App-header"></header>
      <HcpTable data={[]} />
    </div>
  );
};

export default App;
